import React from 'react'

function Opentab(event,Tabname){
    var i ;
   
    var x = document.getElementsByClassName("fhhfh");
    for(i=0; i<x.length; i++){
      x[i].style.display = "none";
    }
    
    var ActiveTabContent=document.getElementById(Tabname)
    ActiveTabContent.style.display = "block"
    
    var y = document.getElementsByClassName("tabs")
    for(i=0; i<y.length; i++){
      y[i].classList.remove("Active");
    }
  
    event.classList.add("Active");
  }

function Header() {
    return (
        <div className="topNav">
        <img src="Meetphoto.JPG" />
        <div className="tab">
            <button className="tabs" onclick={Opentab('Discovery')}><i className="fas fa-compass"></i><br />Discovery</button>
            <button className="tabs" onclick={Opentab('Invited')}><i className="fas fa-user-friends"></i><br />Invited</button>
            <button className="tabs" onclick={Opentab('Support')}><i className="fad fa-user-headset"></i><br />Support</button>  
        </div>
        
            <button className="dhdgdg">Post Job</button>
            <button className="ddbdbd">Sign In</button>
        
    </div>   
   
    )
}

export default Header
